<?php

namespace App\Entity;

use App\Repository\OptionsRepository;
use Doctrine\DBAL\Types\Types;
use Doctrine\ORM\Mapping as ORM;

#[ORM\Entity(repositoryClass: OptionsRepository::class)]
class Options
{
    #[ORM\Id]
    #[ORM\GeneratedValue]
    #[ORM\Column]
    private ?int $id = null;

    #[ORM\OneToOne(inversedBy: 'options', cascade: ['persist', 'remove'])]
    #[ORM\JoinColumn(nullable: false)]
    private ?Company $company_id = null;

    #[ORM\Column(options: ['default' => '[{"example":"2019-12-06 09:43","format":"Y-m-d h:i","is_active":0,"uniq_id":"1"},{"example":"06-12-2019 09:44","format":"d-m-Y h:i","is_active":1,"uniq_id":"2"},{"example":"2019\/12\/06 09:44","format":"Y\/m\/d h:i","is_active":0,"uniq_id":"3"},{"example":"06\/12\/2019 09:43","format":"d\/m\/Y h:i","is_active":0,"uniq_id":"4"}]'])]
    private array $date_format = [];

    #[ORM\Column]
    private ?float $profit = 50;

    #[ORM\Column]
    private ?int $price_decimal_place = 2;

    #[ORM\Column(length: 255)]
    private ?string $part_weight = 'kg';

    #[ORM\Column]
    private ?int $additional_price_column = 6;

    #[ORM\Column]
    private ?int $tax_rate = 10;

    #[ORM\Column]
    private ?int $quote_no_format = 1;

    #[ORM\Column(type: 'text')]
    private ?string $email_body_footer = '<h5><span style="color: rgb(95, 95, 95); font-family: Tahoma; font-size: 14px;">Regards</span><br></h5><p><span style="font-family: Tahoma; font-size: 14px;">Kris</span><span style="font-family: Tahoma; font-size: 14px;">tian</span></p><p><img style="width: 374px;" src="data:image/jpeg;base64," data-filename="Signature2.jpg"></p>';

    #[ORM\Column(type: 'text')]
    private ?string $email_body = '<h5><p><span style="font-family: Tahoma; font-size: 12px;"><span style="font-size: 14px; font-family: Roboto;">Dear </span><span style="font-size: 14px; font-family: Roboto;">[Name],</span></span></p></h5><h5><span style="font-family: Abel; text-align: justify;"><span style="font-family: Tahoma; font-size: 14px;">Please find your quotation as discussed.</span><br></span></h5><h5><span style="font-family: Abel; text-align: justify;"></span><span style="font-family: Tahoma; text-align: justify;"><span style="font-size: 14px; font-family: Roboto;">[Link]</span></span></h5><h5><span style="font-family: Abel;"></span><span style="font-family: Abel; text-align: justify;"><span style="font-family: Tahoma; font-size: 14px;">Do not hesitate to contact us if you have any questions or if you would like to proceed with an order.</span><br></span></h5><p></p>';

    #[ORM\Column]
    private ?string $font_family = 'Tahoma';

    #[ORM\Column]
    private ?int $font_size = 12;

    #[ORM\Column(type: Types::TEXT, nullable: true)]
    private ?string $artwork_email_body_footer = null;

    #[ORM\Column(type: Types::TEXT, nullable: true)]
    private ?string $artwork_email_body = null;

    #[ORM\Column(type: Types::TEXT, nullable: true)]
    private ?string $artwork_email_body_footer_accept = null;

    #[ORM\Column(type: Types::TEXT, nullable: true)]
    private ?string $artwork_email_body_accept = null;

    #[ORM\Column(type: Types::TEXT, nullable: true)]
    private ?string $artwork_email_body_reject_accept = null;

    #[ORM\Column(type: Types::TEXT, nullable: true)]
    private ?string $artwork_email_body_reject = null;

    // TODO: created_at, updated_at

    #[ORM\Column]
    private ?int $custom_quote_number = 0;

    #[ORM\Column(type: Types::TEXT, nullable: true)]
    private ?string $quote_accept_body = null;

    #[ORM\Column(type: Types::TEXT, nullable: true)]
    private ?string $quote_accept_footer = null;

    #[ORM\Column(type: Types::TEXT, nullable: true)]
    private ?string $quote_change_request_body = null;

    #[ORM\Column(type: Types::TEXT, nullable: true)]
    private ?string $quote_change_request_footer = null;

    #[ORM\Column(type: Types::TEXT, nullable: true)]
    private ?string $quote_decline_body = null;

    #[ORM\Column(type: Types::TEXT, nullable: true)]
    private ?string $quote_decline_footer = null;

    public function getId(): ?int
    {
        return $this->id;
    }

    public function getCompanyId(): ?Company
    {
        return $this->company_id;
    }

    public function setCompanyId(Company $company_id): static
    {
        $this->company_id = $company_id;

        return $this;
    }

    public function getDateFormat(): array
    {
        return $this->date_format;
    }

    public function setDateFormat(array $date_format): static
    {
        $this->date_format = $date_format;

        return $this;
    }

    public function getProfit(): ?float
    {
        return $this->profit;
    }

    public function setProfit(float $profit): static
    {
        $this->profit = $profit;

        return $this;
    }

    public function getPriceDecimalPlace(): ?int
    {
        return $this->price_decimal_place;
    }

    public function setPriceDecimalPlace(int $price_decimal_place): static
    {
        $this->price_decimal_place = $price_decimal_place;

        return $this;
    }

    public function getPartWeight(): ?string
    {
        return $this->part_weight;
    }

    public function setPartWeight(string $part_weight): static
    {
        $this->part_weight = $part_weight;

        return $this;
    }

    public function getQuoteAcceptBody(): ?string
    {
        return $this->quote_accept_body;
    }

    public function setQuoteAcceptBody(?string $quote_accept_body): static
    {
        $this->quote_accept_body = $quote_accept_body;

        return $this;
    }

    public function getQuoteAcceptFooter(): ?string
    {
        return $this->quote_accept_footer;
    }

    public function setQuoteAcceptFooter(?string $quote_accept_footer): static
    {
        $this->quote_accept_footer = $quote_accept_footer;

        return $this;
    }

    public function getQuoteChangeRequestBody(): ?string
    {
        return $this->quote_change_request_body;
    }

    public function setQuoteChangeRequestBody(?string $quote_change_request_body): static
    {
        $this->quote_change_request_body = $quote_change_request_body;

        return $this;
    }

    public function getQuoteChangeRequestFooter(): ?string
    {
        return $this->quote_change_request_footer;
    }

    public function setQuoteChangeRequestFooter(?string $quote_change_request_footer): static
    {
        $this->quote_change_request_footer = $quote_change_request_footer;

        return $this;
    }

    public function getQuoteDeclineBody(): ?string
    {
        return $this->quote_decline_body;
    }

    public function setQuoteDeclineBody(?string $quote_decline_body): static
    {
        $this->quote_decline_body = $quote_decline_body;

        return $this;
    }

    public function getQuoteDeclineFooter(): ?string
    {
        return $this->quote_decline_footer;
    }

    public function setQuoteDeclineFooter(?string $quote_decline_footer): static
    {
        $this->quote_decline_footer = $quote_decline_footer;

        return $this;
    }
}
